import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux"
import {
  addEducation,
  deleteEducation,
  deletePortfolio,
  getEmployeeProfile,
  getEmployeeProfileView,
} from "../../../actions/EmplyeeActions";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import DoNotDisturbOnIcon from "@mui/icons-material/DoNotDisturbOn";
import RemoveRedEyeIcon from "@mui/icons-material/RemoveRedEye";
import "swiper/css/effect-coverflow";
import "swiper/css/pagination";
import DeleteIcon from "@mui/icons-material/Delete";
import CloseIcon from "@mui/icons-material/Close";
import EditIcon from "@mui/icons-material/Edit";
import EducationPopup from "../../../components/EducationPopup/educationPopup";
import Spinner from "react-bootstrap/Spinner";
import AddIcon from "@mui/icons-material/Add";

import { EffectCoverflow, Pagination } from "swiper";
import { useNavigate, useParams } from "react-router-dom";
import LanguagePopup from "../../../components/languagePopup/LanguagePopup";
import SkillsPopup from "../../../components/skillsPopup/SkillsPopup";
import InfoPopup from "../../../components/infoPopup/InfoPopup";
import ImagePopup from "../../../components/profileImgPoprup/ProfileImgPopup";
import KycPopup from "../../../components/kcyPopup/KycPopup";
import PortfoilioPopup from "../../../components/PortfolioPopUp.js/PortfoilioPopup";
import BankPopup from "../../../components/BankdetailsPopup/BankDetailsPopup";
import ChangePasswordPopup from "../../../components/changePasswordPopup/chnagePasswordPopup";
import { CHANGE_PASSWORD_FAIL } from "../../../contants/userConstants";
import { PORTFOLIO_FAIL } from "../../../contants/employeeConstants.js";
import { getAllUsers } from "../../../actions/UserAction";

const EmployeePublicView = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  let { userId } = useParams();
console.log(userId);
  const userProfile = useSelector((state) => state.emplyeePublicData);
  const portfolio = useSelector((state) => state.portfolio);
  const User = useSelector((state) => state.user);

  console.log(userProfile);

  const user = useSelector((state) => state.user);
  const [title, setTitle] = useState("");
  const [imgUlr, setImgUrl] = useState("");
  const [description, setDescription] = useState("");
  const [showPortfolio, setShowPortfolio] = useState("");
  const [Id, setId] = useState("");

  const { userData } = userProfile;

  useEffect(() => {
    if (!user?.userInfo) {
      navigate("/login");
    }
   
    dispatch(getEmployeeProfileView(userId));
    dispatch(getAllUsers)
  }, [user]);

  return (
    <div>
    {userProfile?.error ? <div style={{width: '100%', height: '90vh', display: 'flex', justifyContent: 'center', alignItems: 'center'}}><img  src="https://cdn.dribbble.com/users/1554526/screenshots/3399669/media/51c98501bc68499ed0220e1ba286eeaf.png?compress=1&resize=400x300&vertical=top" alt="" /></div> :  <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
        className="emplyerProfile"
      >

      
        <div className="box1">
          <div className="top">
            <div className="left">
              <div className="img-box">
                {userData?.image ? (
                  <img src={userData?.image} alt="" />
                ) : (
                  ''
                )}
              </div>

              <div>
                {" "}
                <p className="common-heading">{User?.userInfo?.name}</p>
                <p
                  style={{
                    marginLeft: "30px",
                    marginTop: "-10px",
                    fontSize: "14px",
                  }}
                >
                  {User?.userInfo?.email}
                </p>
              </div>
            </div>
          </div>

          <div className="bottom">
            <div className="left">
              <div className="left-top">
                <span>
                  <strong>$2434</strong>
                  <p>Total Earnings</p>
                </span>

                <span>
                  <strong>$2434</strong>
                  <p>Total Earnings</p>
                </span>
              </div>

              <div className="left-bottom">
                <span>
                  <h5>Language </h5>
                  {userData?.languages.map((language) => {
                    return (
                      <p style={{ marginLeft: "0px" }}>{language?.language}</p>
                    );
                  })}
                </span>

                <span>
                  <h5>Skills </h5>

                  {userData?.skills.map((education) => {
                    return (
                      <li style={{ marginLeft: "0px" }}>{education?.skill}</li>
                    );
                  })}
                </span>

                <span>
                  <h5>Education </h5>
                  {userData?.educations.map((education) => {
                    return (
                      <ul key={education?._id}>
                        <li>
                          <strong>{education?.school}</strong>{" "}
                        </li>
                        <li>{education?.title}</li>
                      </ul>
                    );
                  })}
                </span>
              </div>
            </div>

            <div className="right">
              <h1 style={{ display: "flex", marginTop: '-100px' }}>{userData?.userTitle}</h1>
              <p style={{ marginTop: "-80px", marginTop: '-400px' }}>{userData?.userInfo}</p>
            </div>
          </div>
        </div>

        <div className="box2">
          <div className="top">
            <p className="common-heading">Work History</p>
          </div>

          <div className="body">
            <div className="left">
              <h4>Make a website</h4>
              <div className="left-text">
                <strong>$25.00</strong>
                <p>Successfully Completed</p>
              </div>
            </div>

            <button></button>
          </div>
        </div>

        <div className="box3 mb-5">
          <div className="top" style={{ display: "flex" }}>
            <p className="common-heading">Portfolio</p>
          </div>
          <div className="bottom">
            <Swiper
              effect={"coverflow"}
              grabCursor={true}
              centeredSlides={true}
              slidesPerView={"4"}
              coverflowEffect={{
                rotate: 80,
                stretch: 0,
                depth: 10,
                modifier: 1,
                slideShadows: false,
              }}
              pagination={true}
              modules={[EffectCoverflow, Pagination]}
              className="mySwiper"
              style={{ width: "1000px" }}
            >
              {userData?.portfolios[0]?.Image ? (
                <SwiperSlide
                  style={{
                    height: "350px",
                    width: "200px",
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                  className="swiperImg"
                >
                  <img
                    style={{ height: "200px", width: "200px" }}
                    src={userData?.portfolios[0]?.Image}
                  />
                  <button
                    onClick={() => {
                      setTitle(userData?.portfolios[0]?.title);
                      setDescription(userData?.portfolios[0]?.description);
                      setShowPortfolio("portfolio");
                      setImgUrl(userData?.portfolios[0]?.Image);
                      setId(userData?.portfolios[0]?._id);
                    }}
                    style={{ marginLeft: "0px" }}
                    className="editIco mt-2 mb-2"
                  >
                    <RemoveRedEyeIcon />
                  </button>
                </SwiperSlide>
              ) : (
                ""
              )}

              {userData?.portfolios[1]?.Image ? (
                <SwiperSlide
                  style={{
                    height: "350px",
                    width: "200px",
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                  className="swiperImg"
                >
                  <img
                    style={{ height: "200px", width: "200px" }}
                    src={userData?.portfolios[1]?.Image}
                  />
                  <button
                    onClick={() => {
                      setTitle(userData?.portfolios[1]?.title);
                      setDescription(userData?.portfolios[1]?.description);
                      setShowPortfolio("portfolio");
                      setImgUrl(userData?.portfolios[1]?.Image);
                      setId(userData?.portfolios[1]?._id);
                    }}
                    style={{ marginLeft: "0px" }}
                    className="editIco mt-2 mb-2"
                  >
                    <RemoveRedEyeIcon />
                  </button>
                </SwiperSlide>
              ) : (
                ""
              )}

              {userData?.portfolios[2]?.Image ? (
                <SwiperSlide
                  style={{
                    height: "350px",
                    width: "200px",
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                  className="swiperImg"
                >
                  <img
                    style={{ height: "200px", width: "200px" }}
                    src={userData?.portfolios[2]?.Image}
                  />
                  <button
                    onClick={() => {
                      setTitle(userData?.portfolios[2]?.title);
                      setDescription(userData?.portfolios[2]?.description);
                      setShowPortfolio("portfolio");
                      setImgUrl(userData?.portfolios[2]?.Image);
                      setId(userData?.portfolios[2]?._id);
                    }}
                    style={{ marginLeft: "0px" }}
                    className="editIco mt-2 mb-2"
                  >
                    <RemoveRedEyeIcon />
                  </button>
                </SwiperSlide>
              ) : (
                ""
              )}

              {userData?.portfolios[3]?.Image ? (
                <SwiperSlide
                  style={{
                    height: "350px",
                    width: "200px",
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                  className="swiperImg"
                >
                  <img
                    style={{ height: "200px", width: "200px" }}
                    src={userData?.portfolios[3]?.Image}
                  />
                  <button
                    onClick={() => {
                      setTitle(userData?.portfolios[3]?.title);
                      setDescription(userData?.portfolios[3]?.description);
                      setShowPortfolio("portfolio");
                      setImgUrl(userData?.portfolios[3]?.Image);
                      setId(userData?.portfolios[3]?._id);
                    }}
                    style={{ marginLeft: "0px" }}
                    className="editIco mt-2 mb-2"
                  >
                    <RemoveRedEyeIcon />
                  </button>
                </SwiperSlide>
              ) : (
                ""
              )}
            </Swiper>
          </div>
        </div>
      </div> }
     

      

      {showPortfolio === "portfolio" ? (
        <div className="port-show">
          <div>
            {" "}
            <CloseIcon
              className="portClose"
              onClick={() => {
                setShowPortfolio("");
              }}
            />
          </div>

          <img src={imgUlr} alt="" />
          <div style={{ display: "flex", alignItems: "center" }}>
            <div>
              <h3 className="mt-5">
                <strong>Title :</strong> {title}
              </h3>
              <p>
                <strong>Description :</strong> {description}
              </p>
            </div>
          </div>
        </div>
      ) : (
        ""
      )}
    </div>
  );
};

export default EmployeePublicView;
